import { Injectable } from '@angular/core';
import * as CryptoJS from 'crypto-js';
/**
 *
 */
@Injectable()
export abstract class CryptoStorage<Name extends string, Keys extends string> {
  /**
   *
   */
  public get name(): Name {
    return this.#name;
  }

  /**
   *
   */
  #name: Name;

  /**
   *
   */
  #hash?: string;

  /**
   *
   * @param name
   * @param passPhrase
   * @param keys
   * @wieldspace
   */
  constructor(name: Name, passPhrase?: string, ...keys: Keys[]) {
    this.#name = name;
    passPhrase && (this.#hash = this.#hashPassphrase(passPhrase));
  }

  /**
   *
   * @param key
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  public get<Key extends Keys>(key: Key, passPhrase?: string): any {
    return this.#decrypt(
      localStorage.getItem(this.#getKeyName(key)),
      passPhrase
    );
  }

  /**
   *
   * @param key
   * @param value
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  public set<Key extends Keys>(
    key: Key,
    value: any,
    passPhrase?: string
  ): this {
    localStorage.setItem(
      this.#getKeyName(key),
      this.#encrypt(value, passPhrase)
    );
    return this;
  }

  /**
   *
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  public setPassPhrase(passPhrase: string): this {
    passPhrase && (this.#hash = this.#hashPassphrase(passPhrase));
    return this;
  }

  //#region private instance methods.
  /**
   *
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  #checkPassphrase(passPhrase: string): boolean {
    return CryptoJS.SHA3(passPhrase).toString() === this.#hash;
  }

  /**
   *
   * @param value
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  #decrypt(value: any, passPhrase?: string): string {
    return CryptoJS.AES.decrypt(
      value,
      passPhrase ? this.#hashPassphrase(passPhrase) : this.#hash || ''
    ).toString(CryptoJS.enc.Utf8);
  }

  /**
   *
   * @param value
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  #encrypt(value: any, passPhrase?: string): string {
    return CryptoJS.AES.encrypt(
      typeof value === 'object' ? JSON.stringify(value) : value,
      passPhrase ? this.#hashPassphrase(passPhrase) : this.#hash || ''
    ).toString();
  }

  /**
   *
   * @param passPhrase
   * @returns
   * @wieldspace
   */
  #hashPassphrase(passPhrase: string): string {
    return CryptoJS.SHA3(passPhrase).toString();
  }

  /**
   *
   * @param key
   * @returns
   * @wieldspace
   */
  #getKeyName<Key extends Keys>(key: Key): string {
    return `${this.#name}${key[0].toUpperCase() + key.slice(1)}`;
  }
  //#endregion private instance methods.
}

